import React from 'react';
import './App.css';
//import Person from './Person/Person';


class App extends React.Component {


  constructor () {
    super();

    this.state = {
      data: [
        {
          "id": 1,
          "name": 'Foo',
          "age": 20
        },
        {
          "id": 1,
          "name": 'Zoo',
          "age": 25
        },
        {
          "id": 1,
          "name": 'Xoo',
          "age": 30
        }
      ]
    }

  }



  render() {
     return (
        <div>
          <p>Test static data</p>
          <Header/>
          <Footer/>
          <table>
            <tbody>
            {this.state.data.map((person, i) => <TableRow key = {i} data = {person} />)}
            </tbody>
          </table>
        </div>
     );
  }
}


class Header extends React.Component {
  render() {
    return (
      <div>
          <p>HEADER</p>
      </div>
    );
  }
}

class Footer extends React.Component {
  render() {
    return (
      <div>
        <p>FOOTER</p>
      </div>
    );
  }
}


export default App;
